css:
.atom-clock {
  color: #82AAFF;
}
.icon {
  color: #65737E;
}
::-webkit-scrollbar {
  display: none;
}
atom-text-editor::shadow .wrap-guide {
  visibility: hidden;
}
atom-text-editor .highlights .highlight-selected .region {
  border-color: #77AEE8;
  border-radius: 3px;
  border-width: 2px;
  border-style: solid;
}
atom-text-editor .highlights .highlight-selected.background .region {
  background-color: #77AEE8;
}
atom-text-editor .highlights .highlight-selected.light-theme .region {
  border-color: #f71010;
}
.highlight-selected-marker-layer.scroll-marker-layer .scroll-marker {
  background-color: #f71010;
}
.highlight-selected-selected-marker-layer.scroll-marker-layer .scroll-marker {
  background-color: #f71010;
}
.minimap-selection .region {
  background: #82AAFF;
}
.minimap-selection .cursor-line {
  background: #D8A57D;
}
.minimap-selection .region-outline {
  background: #82AAFF;
}
atom-text-editor atom-text-editor-minimap {
  background: #15171F;
}
atom-text-editor atom-text-editor-minimap .minimap-scroll-indicator {
  background-color: green;
}
atom-text-editor atom-text-editor-minimap canvas:first-child,
html atom-text-editor-minimap canvas:first-child {
  background: #141417;
}
